        public void isArretAroundPosition(double latPointPassage, double lonPointPassage, double lat, double lon, int iRadius, bool bShouldReturnTrue)
        {
            Arret pointPassage = new Arret { m_lat = latPointPassage, m_lon = lonPointPassage };

            if (bShouldReturnTrue)
                Assert.True(pointPassage.IsAroundPosition_TESTAUTOONLY(lat, lon, iRadius));
            else
                Assert.False(pointPassage.IsAroundPosition_TESTAUTOONLY(lat, lon, iRadius));
        }


        [TestCase("13.42", TestName = "TU_isAvance")] //PointPassage = pharmacie alsace lorraine, position = 43 av Félix Viallet
        public void isZeroAvance(string stoptime)
        {
            Arret pointPassage = new Arret { m_sStopTime = stoptime };

            var test = pointPassage.GetNbMinutsAvance(DateTime.Now);

            Assert.False(test == new System.TimeSpan(0,0,0));
        }


