        public void altiManager(string sJsonListAltiPoints, Pente expectedResult)
        {
            //Desserialize params
            List<Position> lsPoints = JSON.DeserializeObject<List<Position>>(null, sJsonListAltiPoints, "");

            //Create manager and add points
            AltiManager manager = new AltiManager();
            foreach (Position p in lsPoints)
                manager.AddPoint(p);

            Pente testResult = manager.GetCurrentPente();

            Assert.True(testResult == expectedResult, $"La pente n\'est pas la bonne : {testResult} au lieu de {expectedResult}");
        }
        
    }
